pragma solidity 0.5.6;
pragma experimental ABIEncoderV2;


import './DIDUtils.sol';  
import './CredentialStorage.sol';
import './DIDStorage.sol';


/**
 * @title DidLedger
 * @dev This contract is credential storage implementation
 */

//did:kt:0d82ec18df5395bf2ca7611f0648bfc1c935bdd1773c1bb411c42f23318ba9ab
//did:kt:1111ec18df5395bf2ca7611f0648bfc1c935bdd1773c1bb411c42f23318ba9ab
contract CredentialManagement is CredentialStorage {

    modifier checkExistVC(string memory cid){
        require(vcState[cid] == CredentialState.None,"Already Exists Document");
        _;
    }

    modifier checkActiveVC(string memory cid){
        require(vcState[cid] == CredentialState.Active,"VC None or Deactivated");
        _;
    }

    modifier checkAuthority(string memory did, string memory cid){
        require(DIDUtils.equalString( vcs[cid].owner , did) || DIDUtils.equalString( vcs[cid].issuer , did) ,"Not The Owner");
        _;   
    }

    function register(
        string memory uDid,
        string memory iDid,
        string memory cid,
        string memory ciid) public 
        checkExistVC(cid)
        returns(string memory)
    {
        vcs[cid].id = cid;
        vcs[cid].iid = ciid;
        vcs[cid].owner = uDid;
        vcs[cid].issuer = iDid;
        vcState[cid] = CredentialState.Active;


        CredentialId memory ownersVC = CredentialId(cid,false);
        owner[uDid].did = uDid;
        owner[uDid].vcIds.push(ownersVC);
    }

//modify
    function getVCIID(
        string memory cid
        )public view
        returns(string memory)
    {
        string memory ciid = vcs[cid].iid;
        return ciid ; 

    }

    function getVC(
        string memory cid,
        string memory uDid) public view 
        checkAuthority(uDid,cid) checkActiveVC(cid)
        returns(Credential memory) 
    {

        Credential memory vc = vcs[cid];
        return vc;
    }

    function getOwnersVC(
        string memory did
    )public view
    returns(Owner memory)
    {
        Owner memory ownersVC = owner[did];
        // for(uint256 i=0;i<ownersVC.vcIds.length;i++){
        //     if(ownersVC.vcIds[i].disable) delete ownersVC.vcIds[i];
        // }

        return ownersVC;
    }

//modify
    function revokeAll(
        string memory did
    ) public 
    {
         for(uint256 i=0;i<owner[did].vcIds.length;i++) {
             string memory cid = owner[did].vcIds[i].id;
             vcState[cid] = CredentialState.Deactivated;
             owner[did].vcIds[i].disable = true;

        }

    }

    function getDisable(
        string memory did,
        string memory cid
    )public view returns(bool)
    {

         for(uint256 i=0;i<owner[did].vcIds.length;i++) {
             string memory id = owner[did].vcIds[i].id;
            if(DIDUtils.equalString(id,cid)) {
                return owner[did].vcIds[i].disable ;
            }
        }

    }

    function getState(
        string memory cid 
    )public view returns(CredentialState ) 
    {
        return vcState[cid];
    }


    function revokeOpt(
        string memory cid,
        string memory did) public 
        checkAuthority(did,cid) checkActiveVC(cid)
    {

        for(uint256 i=0; i<owner[did].vcIds.length; i++){
            string memory id = owner[did].vcIds[i].id;
            if(DIDUtils.equalString(id,cid)){
                owner[did].vcIds[i].disable = true;
            }
        }
    }


}
